    price,
    description,
    category,
    image}) => {
    return (
        <div>
            <img className="w-[200px]" src={image} alt={title}/>
           <p>{title}</p>
           <p>{price}</p>
           <p>{description}</p>
           <p>{category}</p>
        </div>
    )
}

export default Item
